window.bookSummaryJSON = "<p>The national best-selling Black Jewels trilogy established award-winning Anne Bishop as an author whose \"sublime skill...blends the darkly macabre with spine-tingling emotional intensity, mesmerizing magic, lush sensuality, and exciting action.\" (SF Site) Now the saga continues - with four new adventures of Jaenelle and her kindred. </p> <p>In <i>Dreams Made Flesh</i>, discover the origin of the mystical Jewels, and experience the forbidden passion between Lucivar and a simple hearth witch. Witness the clash between Saetan and a Priestess that may forever change reality. And learn whether the sacrifice of Jaenelle's magic has destroyed any hope of happiness between her and Daemon.</p>"; 
